  [],\n\t\"num_tags\": 0,\n\t\"name\": \"sensitivity-of-coastal-environments-and-wildlife-to-spilled-oil-upper-coast-of-texas-birds-bird\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains sensitive biological
  resource data for diving birds, gulls, terns, passerine birds, pelagic birds, raptors,
  shorebirds, wading birds, waterfowl, and landfowl for the Upper Coast of Texas.
  Vector polygons in this data set represent bird nesting, migratory staging, and
  wintering sites. Species-specific abundance, seasonality, status, life history,
  and source information are stored in relational data tables (described below) designed
  to be used in conjunction with this spatial data layer. This data set comprises
  a portion of the ESI data for the Upper Coast of Texas. ESI data characterize the
  marine and coastal environments and wildlife by their sensitivity to spilled oil.
  The ESI data include information for three main components: shoreline habitats,
  sensitive biological resources, and human-use resources. See also the NESTS (Nest
  Points) data layer, part of the larger Upper Coast of Texas ESI database, for additional
  bird information.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
